import React from 'react';
import { Route, Redirect } from 'react-router-dom';

const ProtectedRoute = ({ loggedIn }) => {
  return loggedIn ? <Route exact path="/"/> : <Redirect to="/signin" />;
};

export default ProtectedRoute
